import React from 'react'
import Carousel from 'react-bootstrap/Carousel'

const Banner = ({banner}) => {
  return (
    <Carousel fade>
    {banner.map((item)=>(
         <Carousel.Item>
          <img
          className='d-block w-100'
          src={item}
          alt='First Slide'
          />
         </Carousel.Item>
    ))}
   </Carousel>
  )
}

export default Banner
